import { Outlet } from 'react-router-dom';
import './layouts.css';
import MenuTop from './menutop';
import MenuBox from './menubox';

const Layout=()=>
    {
        return (
            <body>
                <header>
                    <div class = 'main_menu_top'><MenuTop/></div>
                    

                    {/* <div class = 'main_menu_box'><MenuBox/></div> */}
                    <div class="news-home">
                    <div class="container_main" style={{minHeight:500}} >
                    <Outlet/>
                    </div>
                </div>
                </header>

    

            </body>
        
        );
    };

export default Layout;
